(2, 'hs_activity_02_en', 'Activity #1: Mansa Musa & Shamba\r', 'en', '# Activity #1: Mansa Musa & Shamba\r\nSummary: This multi-task activity examines African leadership through the lens of peace, challenging stereotypes of African kings as solely aggressive or warlike. Students study leaders such as King Shamba Bolongongo of the Kuba Kingdom, Mansa Musa of Mali, and modern figures Colin Kaepernick and Lewis Hamilton, exploring how peace, justice, and identity shape leadership. Through reading, video analysis, persuasive writing, creative responses, historical comparison, and media analysis, students connect past and present leaders while developing critical thinking, communication, and digital literacy skills.\r\nSubjects:\r\n- English\r\n- Media Studies', '[0.02297097,-0.0057555255,0.015940346,0.013025831,-0.009312383,0.0361502,-0.0067621833,0.022728095,0.0180751,0.039678294,0.02162876,-0.026128361,-0.05194993,-0.03006551,0.0065161115,0.04586524,-0.06677816,0.04039414,0.02616671,0.058494803,0.029017309,0.07659547,-0.010245538,0.0890205,-0.045174964,0.032673232,-0.05726764,0.032724366,0.013511583,-0.01081438,0.052665774,-0.009043941,-0.036993872,0.049521167,-0.027892409,0.018190145,-0.06488628,-0.009369906,0.016579492,-0.011920106,0.011498268,-0.057216506,-0.053790677,0.00523462,0.026920903,-0.012898002,-0.0242237,-0.039115842,0.0053880154,0.046223167,-0.0032980025,0.0067238347,-0.022012249,-0.034156058,0.0151478015,0.01769161,0.014150731,-0.03556218,-0.07368095,-0.029119572,-0.012495339,-0.0115430085,-0.0059185084,0.019762449,-0.011690012,-0.032417573,-0.03788868,-0.0506972,0.027687881,-0.0339004,0.031471636,0.013370971,0.046018638,0.0169502,-0.03576671,-0.038093206,-0.0372751,0.010916644,-0.016617842,0.00596964,-0.009753395,0.00071384816,0.0047776294,0.043666575,0.01331984,0.006596005,-0.0530237,-0.009325166,-0.014930491,-0.01825406,-0.02275366,0.0061869505,-0.023380024,0.03926924,0.0743968,-0.002481491,-0.011805059,0.016144872,0.018918773,0.0404964,-0.02465832,-