(3, 'hs_activity_03_en', 'Activity #2: The Richest Man Who Ever Lived (Mansa Musa)\r', 'en', '# Activity #2: The Richest Man Who Ever Lived (Mansa Musa)\r\nSummary: This activity introduces students to Mansa Musa, the legendary 14th-century emperor of Mali, whose wealth, leadership, and cultural influence shaped African and world history. Through historical inquiry and chronological thinking, students create illustrated timelines, identify significant events, and connect them to broader themes of trade, religion, and education. Students develop critical literacy and media analysis skills by comparing videos, biographies, and articles for tone, audience, purpose, and bias, while assessing credibility and significance. They write reflective/persuasive blog entries using evidence and citations, and present ideas through discussions and multimodal reflections.\r\nSubjects:\r\n- English\r\n- World Studies\r\n- Social Sciences', '[0.031348538,-0.028122514,-0.015089844,0.014259961,0.0023596145,0.022663988,-0.0432708,0.04780594,-0.00037549285,0.051616386,0.02086396,-0.013991127,-0.04932544,-0.03978763,0.030670606,0.029057594,-0.051850155,0.003649732,-0.006095549,0.022699054,0.041049987,0.057367124,-0.05245796,0.07522714,-0.014014503,0.010402759,-0.049652718,0.031699196,0.0355564,-0.012156033,0.032938175,-0.01403788,-0.0073053082,0.041844808,-0.053252775,-0.025808193,-0.05615152,-0.0032026472,0.012296295,-0.006662441,0.004573123,-0.053626806,-0.04493057,0.009193,0.021541893,0.003223102,-0.025340654,-0.02435882,0.027654976,0.045631878,-0.012997605,-0.004839036,-0.012950851,-0.040605824,0.0029060517,0.0059056114,-0.011501477,-0.01520673,-0.09037543,-0.047735807,-0.016714545,0.017579494,-0.004929622,-0.0071416693,-0.019636668,-0.037660327,-0.051943664,0.014411912,0.041400645,-0.005145859,0.0014793249,0.007013096,0.026813403,0.035042103,-0.008333895,-0.049979996,-0.036631737,-0.015849598,-0.03406027,-0.033242077,0.013441768,-0.006113082,-0.03319532,0.0653153,0.024195181,0.008894