(4, 'hs_activity_04_en', 'Activity #3: Adinkra Symbols\r', 'en', '# Activity #3: Adinkra Symbols\r\nSummary: Students explore the cultural, historical, and communicative significance of Adinkra symbols from Ghana, integrating research, visual literacy, and creative expression. They follow the Big 6 research process, build source evaluation and citation skills, and design an original Adinkra-inspired symbol reflecting identity or a contemporary message. Includes vocabulary building, reflective/explanatory writing, and peer discussion.\r\nSubjects:\r\n- English\r\n- World Studies\r\n- Social Sciences\r\n- Arts', '[0.050337538,-0.015930701,0.006493964,0.0016079702,-0.007828766,-0.009275318,0.008344062,0.012336049,0.0050536203,0.028061872,0.0078970585,-0.017358627,-0.047779683,-0.043533154,0.014440689,0.048425358,-0.035487093,0.0034518586,0.02110849,0.04358282,0.050387204,0.039808128,-0.04251498,0.0723152,0.010156908,-0.014775942,-0.024212679,0.02002823,0.0058048344,-0.027242366,0.051455047,-0.018277468,-0.010920539,-5.8882593e-5,-0.043185484,-0.028285375,-0.032258738,0.0043986365,-0.0057706884,-0.027987372,0.008555146,-0.011746253,-0.04186931,-0.005929002,-0.032184236,0.05304439,-0.0033276912,-0.04335932,-0.0024414451,0.05572641,0.006369797,0.011901462,0.008455812,-0.020810487,-0.038740285,-0.018339552,-0.024262344,0.0039733625,-0.06878884,-0.053640395,-0.0102065755,-0.012348466,0.014502773,0.017445546,-0.029601552,-0.0066802157,-0.028583378,0.020264149,0.013869518,-0.0031709296,0.0634248,0.049294528,0.029229049,0.0028651669,-0.029278716,-0.0009436736,-0.015992785,-0.01708546,0.013223847,-0.009064233,-0.0005746631,-4.699937e-5,-0.018972807,0.04879786,0.024883183,-0.025752356,-0.045346,-0.035934098,-0.047978353,0.002472487,-0.007878433,0.009672655,-0.01497461,0.052001383,0.046240006,-0.017718714,-0.039733626,-0.0023731529,0.0119697545,0.038814787,0.004619034,-0.007456263,-0.015930701,0.017097875,0.04422849,0.00013939751,0.013484599,0.011367542,-0.03856645,0.004581784,-0