(31, 'hs_activity_31_en', 'Activity #30: Engineering and Innovation in Ancient Africa\r', 'en', '# Activity #30: Engineering and Innovation in Ancient Africa\r\nSummary: Students explore pre-colonial African engineering/architecture/metallurgy/navigation/city planning through case studies (Pyramids, Great Zimbabwe, Benin City fractals, Lalibela churches, maritime tech, Benin Bronzes). Builds academic vocabulary, research reading, explanatory/persuasive writing, oral presentations, reflection, visual analysis, and compare historical vs modern techniques.\r\nSubjects:\r\n- English\r\n- Science\r\n- Canadian & World Studies\r\n- Math\r\n- The Arts', '[0.028392233,0.03717525,0.010594018,-0.0041858642,3.516379e-5,0.0320275,-0.019211194,0.0078211315,-0.020219516,0.07233386,0.00020336434,-0.058376554,-0.060552407,0.0040697744,0.03147027,0.06028706,-0.0483464,0.017552769,-0.015522856,0.07397901,0.055404656,0.023549633,-0.04303944,0.04630322,-0.024226269,-0.014421662,-0.018335545,0.020524666,0.0064313714,-0.009313714,0.04152696,-0.018242672,-0.03253166,0.036034252,-0.034866724,0.005469485,-0.01927753,0.003286998,0.030355807,-0.017234351,0.024491617,-0.011569171,-0.028445302,0.0072639007,-0.02707876,0.017964058,-0.027702328,-0.014050175,0.024239536,0.052485827,0.01540345,0.033327706,0.0074430103,-0.07233386,0.0037845254,-0.011137981,-0.029294416,-0.008398264,-0.07127246,-0.049540468,-0.0074032084,-0.03351345,0.041633096,0.040253285,-0.014779882,0.015018695,-0.037095647,-0.005383247,0.0023118441,-0.030488482,0.009134604,0.05431673,0.01081293,0.023828248,0.008491135,-0.06416114,-0.039775662,-0.0009469606,-0.025844892,0.0007848495,-0.02580509,-0.016080087,0.02662767,0.02733084,0.0011749939,-0.042667955,-0.05007116,-0.053122662,-0.034919795,-0.013625618,-0.051902063,-0.0096520325,-0.0012380141,0.04988542,0.046090942,-0.012922446,-0.009041732,0.03478712,0.023761911,0.05710288,-0.00050540495,-0.067610666,0.03346038,0.043994695,0.059915572,-0.010010252,0.011257388,0.009525992,-0.001