(32, 'site_info_en', 'Site Info', 'en', 'My Place In This World — Website Info (Approved)\r\n\r\nWhat is “My Place In This World”?\r\n- “My Place In This World” is an educational website with classroom-ready learning activities that help teachers and students explore African history, leadership, identity, culture, and legacy.\r\n- The site includes a “Divisions of Learning” area with Courses → Lessons → Tasks. Tasks can include notes, resources (PDF/link/video), and learning progress tracking.\r\n\r\nWho is it for?\r\n- Schools, educators, and classrooms. Schools can create an account and (optionally) add educator sub-users.\r\n\r\nHow do memberships work?\r\n- High School content is included by default for school accounts (free base access).\r\n- Primary and Junior Intermediate are paid add-ons (monthly or yearly).\r\n\r\nWhere do I find things?\r\n- About Us: background info and creator bios\r\n- Membership: pricing and membership levels\r\n- Gallery of Growth: classroom examples and posts\r\n- Divisions of Learning: the activities (login required; access depends on membership)\r\n\r\nSupport / Contact\r\n- Use the Contact Us page or the Support Ticket form on the site.\r\n- Phone: +1 519-222-7714\r\n- Email: lorraine@myplaceinthisworld.ca\r\n\r\nLimits\r\n- If a question isn’t covered by the approved materials, direct users to Contact Us / Support.', '[0.020197993,-0.0007150168,0.043896206,0.022392802,-0.0009136077,-0.039736107,-0.014918972,0.0350022,-0.02869033,0.034284946,0.03910492,-0.006763745,-0.045990597,-0.031588055,0.017888421,0.04343716,-0.024702374,0.045588933,0.0070614074,0.08371838,0.036953144,0.010063133,-0.055257577,0.05990541,-0.029895324,-0.0655861,-0.04840059,-0.012924993,-0.005906622,-0.021933757,0.051183548,-0.010672803,-0.05654864,0.068397745,-0.02652421,-0.063520394,0.012014076,0.025964748,0.050150696,-0.03376852,-0.020585312,0.025175765,-0.009102007,0.02946497,-0.0462775,0.011088813,-0.008657307,-0.012946512,0.011590893,0.014510134,-0.000648